import React, {Component} from 'react';

class Body extends Component{
	render(props){
		const results=this.props.data;
		return(
			<div>
				<ul>
					 { results.map(item => <li>{item.title}</li>)}
				</ul>
			</div>
		)
	}
};

export default Body;
